transforms.result:
.list-enter-active,
.list-leave-active {
  transition: all 0.5s ease;
}
.list-enter-from,
.list-leave-to {
  opacity: 0;
  transform: translateY(-20px);
}

.contact-list {
  &__list {
    display: flex;
    flex-direction: column;
    gap: 16px;
  }

  &__title {
    border-radius: 12px;
    padding: 10px 16px;
    border: 2px solid teal;
    display: flex;
    gap: 12px;
    background-color: teal;
  }

  &__title-item {
    color: white;
    flex: 0 0 23%;
  }

  &__transition {
    display: flex;
    flex-direction: column;
    gap: 16px;
  }

  &__items {
    border-radius: 12px;
    padding: 10px 16px;
    border: 2px solid teal;
    display: flex;
    gap: 12px;
  }
}
